Charles has come downstairs after Thanksgiving dinner to go out jogging. He needs to get rid of all the good food he ate! His wife's personal assistant, Dayna, is still helping with the desserts and offers Charles a piece of pumpkin pie. He initially refuses, but when she offers him some whipped cream for the pie, his dirty mind kicks in. He wants the whipped cream alright......to lick off Dayna's scrumptious body.
